import React from 'react'
import {Box} from '@material-ui/core'
function Contact() {
    return (
        <Box style={{marginTop:"64px",display:"flex",justifyContent:"center",alignItems:"center"}}>
            Contact Us
        </Box>
    )
}

export default Contact
